import React from "react";
import DistancSlider from "./DistanceSlider";
import PriceSlider from './PriceSlider'
import RatingsSlider from './RatingsSlider'
import faker from "faker";
import Card from "../cardDetails/Cards";

import Grid from "@material-ui/core/Grid";

class CardPage extends React.Component {
  constructor(props) {
    console.log("bas ek bar call hona hai tujhe");
    super(props);
  }

  jain = {
    actual: null,
    array: [
      <Card
        imgsrc={faker.image.avatar()}
        distance={20}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={30}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={40}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={50}
        ratings="3"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={60}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={90}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={100}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
    ],
  };

  checkvalue1 = (v) => {
    console.log(v);
  };

  render() {
    return (
      <div>
        <Grid container spacing={3}>
          <Grid item xs={4}>
            <DistancSlider checkvalue={2} />
          </Grid>
          <Grid item xs={4}>
            <Slider />
          </Grid>
          <Grid item xs={4}>
            <Price />
          </Grid>
          <Grid item xs={4}>
            <Down />
          </Grid>
          <Grid item xs={4}>
            <Bdown />
          </Grid>
        </Grid>
        {/* {this.jain.array.map((items, index) => {
          return this.jain.array[5].props.actual >=
            this.jain.array[index].props.distance
            ? this.jain.array[index]
            : null;
        })} */}
      </div>
    );
  }
}

export default CardPage;
